webpackJsonp([32551418774257],{849:function(e,a){e.exports={data:{page:{id:"C:/Users/mattd/Code/portfolio/content/pages/2--work/index.md absPath of file >>> MarkdownRemark",html:'<p>My coding interests outside of work are few but I create some fun stuff every once in awhile.</p>\n<h2>Websites</h2>\n<h3><a href="http://redditdata.live">RedditData.live</a></h3>\n<p>A live visualization of new reddit posts powered by <a href="https://pushshift.io">pushshift.io</a>, built with <a href="https://reactjs.org">React</a>, and inspired by <a href="https://www.bitlisten.com">Bitlisten</a>.   </p>\n<h3><a href="http://hasmexicopaidforthewallyet.com">HasMexicoPaidForTheWallYet.com</a></h3>\n<p>A simple site to let you know if Mexico has paid for the border wall yet.</p>\n<h3><a href="http://www.doyouremember.today">DoYouRemember.Today</a></h3>\n<p>A tribute to Earth Wind, and Fire. On September 21st this site will display a special surprise but doesn’t seem to care about any other day…</p>\n<h3><a href="https://aero.mattfoxx.me/">aero.mattfoxx.me</a></h3>\n<p>A <a href="http://www.virtualradarserver.co.uk/">Virtual Radar Server</a> instance receiving <a href="https://en.wikipedia.org/wiki/Automatic_dependent_surveillance_%E2%80%93_broadcast">ADS-B</a> data at my home, allowing real-time tracking of aircraft in its proximity.</p>\n<h2>Libraries/Open-Source</h2>\n<ul>\n<li><a href="https://github.com/FoxxMD/discoFoxx">discoFoxx</a> - A an extensible wrapper for <a href="https://discord.js.org">discord.js</a> that makes writing <a href="https://discordapp.com/">Discord</a> bots easy!</li>\n<li><a href="https://github.com/FoxxMD/intellij-jvm-options-explained">intellij-jvm-options-explained</a> - A helpful primer for JVM options relevant to tweaking <a href="https://www.jetbrains.com/">Jetbrains</a> IDE products. Thorough explanations of what options do and recommended values.</li>\n<li><a href="https://github.com/FoxxMD/laravel-elasticbeanstalk-queue-worker">laravel-elasticbeanstalk-queue-worker</a> - Provides an easy way to deploy <a href="https://laravel.com/">Laravel</a> projects as queue consumers using <a href="http://supervisord.org/">supervisord</a> in <a href="https://aws.amazon.com/elasticbeanstalk/">Amazon Elastic Beanstalk</a> environments.</li>\n<li><a href="https://github.com/FoxxMD/laravel-elasticbeanstalk-cron">laravel-elasticbeanstalk-cron</a> - An alternative to ELB (Elastic Beanstalk) cron management for Laravel projects where a selected leader instance runs the built-in Laravel scheduler.</li>\n<li><a href="https://github.com/Fulfillment-dot-com/laravel-triaged-queues">laravel-triaged-queues</a> - An extension of <a href="https://laravel.com/docs/5.1/queues">Laravel 5.1 Queues</a> that adds fallback hosts and extended beanstalkd functions.</li>\n<li><a href="https://github.com/FoxxMD/react-cowsay">react-cowsay</a> - A simple <a href="https://reactjs.org/">React</a> wrapper for <a href="https://github.com/bushmango/cowsay-browser">cowsay</a>, the configurable talking cow.</li>\n<li><a href="dhl-ecommerce-api">dhl-ecommerce-api</a> - A PHP wrapper for HTTP communication with the <a href="https://api.dhlglobalmail.com/docs/v1/">DHL eCommerce API</a></li>\n<li><a href="https://github.com/FoxxMD/react-interpunct">react-interpunct</a> - React component to visibly display whitespace characters</li>\n<li><a href="https://github.com/FoxxMD/sendmail-ses-elasticbeanstalk">sendmail-ses-elasticbeanstalk</a> - A set of <a href="https://docs.aws.amazon.com/elasticbeanstalk/latest/dg/ebextensions.html">ebextension</a> files for <a href="https://aws.amazon.com/elasticbeanstalk/">Amazon Elastic Beanstalk</a> that automate configuring <a href="https://linux.die.net/man/8/sendmail.sendmail">sendmail</a> with <a href="https://aws.amazon.com/ses/">Amazong SES</a>. </li>\n<li><a href="https://github.com/FoxxMD/unraid-docker-templates">unraid-docker-templates</a> - A repository of templates for <a href="https://unraid.net/">Unraid</a>, available through Community Apps, that configure various <a href="https://www.docker.com/">Docker</a> services.</li>\n</ul>\n<h3>Publicly Available Work</h3>\n<ul>\n<li><a href="https://fulfillment.github.io/api">Fulfillment.com API</a> (2014-Present) - Lead developer behind the public and private API set for <a href="https://fulfillment.com">Fulfillment.com</a>, a global <a href="https://en.wikipedia.org/wiki/Third-party_logistics">3PL</a> fulfillment house.</li>\n</ul>',frontmatter:{title:"Coding, Projects, and Work"}},footnote:{id:"C:/Users/mattd/Code/portfolio/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>This site is based on gatsby-starter-personal-blog built by <a href="https://www.greglobinski.com">greg lobinski</a></li>\n<li>with <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a></li>\n<li>photos by me</li>\n</ul>'},site:{siteMetadata:{facebook:{appId:""}}}},pathContext:{slug:"/work/"}}}});
